import logo from './logo.svg';
import './App.css';
import * as React from 'react';
import ListStaffComponent from './components/ListStaffComponent';
import HeaderComponent from './components/HeaderComponent';


function App() {
  return (
    <div>
      <HeaderComponent />
        <div className="container">
          <ListStaffComponent />
        </div>
    </div>
  );
}

export default App;
